import styled from 'styled-components';

export const FooterStyle = styled.footer`
    display: flex;
    justify-content: center;
    position: fixed;
    bottom: 0;
    width: 100%;
    height: 100px;
    align-items: center;
    color: #d3d3d3;
`

export const ContactItem = styled.div`
    p {
        display: inline; 
    }
`

export const Icon = styled.div`
    display: inline;
    margin-top: 20%; 


`
